// import logo from './logo.svg';
import './App.css';
import CirclesWithBar from 'react-loader-spinner';

function App() {
  return (
    <div className="App">
      <CirclesWithBar
        height="100"
        width="100"
        color="#4fa94d"
        wrapperStyle={{}}
        wrapperClass=""
        visible={true}
        outerCircleColor=""
        innerCircleColor=""
        barColor=""
        ariaLabel='circles-with-bar-loading'
      />
    </div>
  );
}

export default App;
